@savagerace Florida last weekend was my final OCR of the year! Finished out the points series with some hot weather and spicy obstacles- great finale! 🔥 

@jme.ocr.chick and @courtwash09 crushed it in 🥇 and 🥈, and I was happy to finish in 🥉 in any race against these gals- but especially after the past couple weeks of some pretty high and intense mileage. 

Brought home a win in the overall series, and enjoyed getting a little sun before settling into winter and a bit more of a strength and power direction- Hyrox and deka up next!

